def create_policy_mapping(new_layout_policy_list, layout_policy_list):
    policy_mapping = np.zeros(len(new_layout_policy_list), dtype=np.uint32)

    # remap data into the order that we need.
    for dst_policy_id in range(len(new_layout_policy_list)):
        for src_policy_id in range(len(layout_policy_list)):
            if(layout_policy_list[src_policy_id] == new_layout_policy_list[dst_policy_id]):
                policy_mapping[dst_policy_id] = int(src_policy_id)
    print(policy_mapping)
    return policy_mapping

def reorder_to_given_policy_list(policy_mapping, data):
    reordered_data = np.zeros([data.shape[0], len(policy_mapping)], dtype=float)
    for dst_policy_id in range(len(policy_mapping)):
        reordered_data[:, dst_policy_id] = data[:, policy_mapping[dst_policy_id]]
    return reordered_data


